groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"data_source":{"id":"1036"},"glyph":{"id":"1065"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1068"}},"id":"1067","type":"GlyphRenderer"},{"attributes":{},"id":"1232","type":"BasicTickFormatter"},{"attributes":{"months":[0,4,8]},"id":"1259","type":"MonthsTicker"},{"attributes":{},"id":"1156","type":"CategoricalScale"},{"attributes":{},"id":"1238","type":"BasicTickFormatter"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1250","type":"AdaptiveTicker"},{"attributes":{"below":[{"id":"1081"}],"center":[{"id":"1084"},{"id":"1088"}],"left":[{"id":"1085"}],"renderers":[{"id":"1102"}],"sizing_mode":"stretch_both","title":{"id":"1222"},"toolbar":{"id":"1094"},"x_range":{"id":"1073"},"x_scale":{"id":"1077"},"y_range":{"id":"1075"},"y_scale":{"id":"1079"}},"id":"1072","subtype":"Figure","type":"Plot"},{"attributes":{"factors":[]},"id":"1184","type":"FactorRange"},{"attributes":{"formatter":{"id":"1248"},"ticker":{"id":"1195"}},"id":"1194","type":"CategoricalAxis"},{"attributes":{},"id":"1261","type":"YearsTicker"},{"attributes":{},"id":"1159","type":"CategoricalTicker"},{"attributes":{"source":{"id":"1145"}},"id":"1169","type":"CDSView"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1277"},"selection_policy"
